import React from 'react';
import data from "../Cards/CardData.json"

export function Card() {
    return (
        <div>
            {data.map((val) => (
                <div key={val.id}>
                    <img src={val.img} alt={val.name} />
                    <p>{val.name}</p>
                    <p>{val.category}</p>
                </div>
            ))}
        </div>
    )
}

// export default Card
